import React from 'react';
import Spline from '@splinetool/react-spline';

export default function Home() {
  return (
    <div style={{ position: 'relative', height: '100vh', width: '100vw', overflow: 'hidden' }}>
      <Spline
        scene="https://prod.spline.design/3z9PPkKZWxSG4JeS/scene.splinecode"
        style={{
          position: 'absolute',  // Makes sure the Spline scene is positioned relative to its container
          top: 0,
          left: 0,
          width: '100%',
          height: '100%',
          objectFit: 'cover', // Ensures the background scene covers the entire area
        }}
      />
      <h1
        style={{
          position: 'absolute', // This ensures it stays on top of the scene
          top: '50%', // Centers the text vertically
          left: '50%', // Centers the text horizontally
          transform: 'translate(-50%, -50%)', // Adjusts for perfect centering
          color: '#fff', // White text for better contrast
          zIndex: 1, // Makes sure it's above the Spline scene
        }}
      >
        Welcome to UniFix!
      </h1>
    </div>
  );
}
